import React from "react";

const Footer = () => {
  return (
    <div>
      <footer style={footerStyle}>
        <div>
          <a
            href="https://www.youtube.com/your-channel"
            target="_blank"
            rel="noopener noreferrer"
          >
            YouTube
          </a>
          <a
            href="https://www.instagram.com/your-account"
            target="_blank"
            rel="noopener noreferrer"
          >
            Instagram
          </a>
        </div>
      </footer>
    </div>
  );
};

export default Footer;
